import React from "react";
import { clients } from "../data/client";

function ListeClients() {
    return (
        <div>
            <h1> Liste des clients </h1>
            <table>
                <thead>
                    <tr>
                        <th> Nom </th>
                        <th> Ville </th>
                        <th> Telephone </th>
                    </tr>
                </thead>
                <tbody>
                    {clients.map(client => (
                        <tr key={client.id}>
                            <td> {client.nom} </td>
                            <td> {client.ville} </td>
                            <td> {client.Tel} </td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    )
}

export default ListeClients;
